<iframe src="https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3180.4992400644715!2d-56.87708979351423!3d-37.140826971317246!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x959c9daeb64d72d3%3A0x7618f66397e31da!2sComplejo%20Ostra%20Negra!5e0!3m2!1ses-419!2sar!4v1676655116575!5m2!1ses-419!2sar" width="600" height="450" style={{border: 0}} allowFullScreen="" loading="lazy" referrerPolicy="no-referrer-when-downgrade"></iframe>

